import { Card } from "react-bootstrap";

function PokemonCard({ name, image }) {
  return (
    <Card
      style={{
        width: "12rem",
        height: "10rem",
        border: "2px solid",
        borderRadius: "10%",
        padding: "10px",
      }}
    >
      <Card.Img variant="top" src={image} width={"100%"} />
      <Card.Body>
        <Card.Title style={{ textAlign: "center", fontSize: "1.5rem" }}>
          {name}
        </Card.Title>
      </Card.Body>
    </Card>
  );
}

export default PokemonCard;
